import { useContext } from 'react'
import Global from '../../context/Global'
import { Route, Routes } from 'react-router-dom'
import { DataPublick, DataPrivate } from './Data'

const Router = () => {
    const {localStore} = useContext(Global)
    const DataPaths = localStore.User.isAuth ? DataPrivate : DataPublick  
  
    return (
    <Routes>
        {
            DataPaths.map(data => {
                return <Route path={data.path} element={data.element} key={data.id}></Route>
            })
        }
    </Routes>
  )
}

export default Router
